import React from 'react';
import MyContext from './my_context.js';




class PriceTrending extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            change: '0.0',
        };
    }
    //{ market_data.change(this.props.dataa_list, market_data.data) }
	render() {
		return (
			<div>
				<MyContext.Consumer>
					{
						market_data => {
							return (
								<div>
									{ market_data.change(this.props.data_list, market_data.data) }
								</div>
							)
						}
					}
				</MyContext.Consumer>
			</div>
		);
	}
}

export default PriceTrending;
